function Navbar(){
    return (
        <div className="div">
            <ul className="navbar">
                <il ><button className="box">Home</button></il>
                <il className="box">Bio</il>
                <il className="box">Education</il>
                <il className="box">Projects</il>
                <il className="box">Work</il>
            </ul>
        </div>
    )
}

export default Navbar;
